if getgenv().AntiLag_Active then return end
getgenv().AntiLag_Active = true

task.spawn(function()
    local Players = game:GetService("Players")
    local LP = Players.LocalPlayer
    local Workspace = game:GetService("Workspace")
    local Lighting = game:GetService("Lighting")
    local RunService = game:GetService("RunService")

    local COLOR_LOCAL = Color3.fromRGB(150,150,150)
    local ACC_TRANSP = 1
    local MATERIAL = Enum.Material.SmoothPlastic

    local function disableAnimations(char)
        if not char then return end
        for _, obj in ipairs(char:GetDescendants()) do
            if obj:IsA("Tool") then
                local h = obj:FindFirstChild("Handle")
                if h and h:IsA("BasePart") then
                    pcall(function() h.LocalTransparencyModifier = ACC_TRANSP end)
                end
            end
        end
    end

    local function removeAllAccessories(char)
        for _, item in ipairs(char:GetChildren()) do
            if item:IsA("Accessory")
                or item:IsA("LayeredClothing")
                or item:IsA("Shirt")
                or item:IsA("ShirtGraphic")
                or item:IsA("Pants")
                or item:IsA("BodyColors")
                or item:IsA("CharacterMesh") then
                pcall(function() item:Destroy() end)
            end
        end
    end

    local function applyAntiLag(char, isLocal)
        if not char or not char.Parent then return end

        if isLocal then
            local hl = char:FindFirstChild("AntiLagHighlight")
            if not hl then
                hl = Instance.new("Highlight")
                hl.Name = "AntiLagHighlight"
                hl.DepthMode = Enum.HighlightDepthMode.AlwaysOnTop
                hl.Parent = char
            end
            hl.Adornee = char
            hl.FillColor = COLOR_LOCAL
            hl.OutlineColor = COLOR_LOCAL
            hl.FillTransparency = 0
            hl.OutlineTransparency = 0
        else
            local existingHL = char:FindFirstChild("AntiLagHighlight")
            if existingHL then existingHL:Destroy() end
        end

        for _, d in ipairs(char:GetDescendants()) do
            if d:IsA("ParticleEmitter") or d:IsA("Trail") or d:IsA("Beam")
            or d:IsA("Fire") or d:IsA("Smoke") or d:IsA("Sparkles") then
                d.Enabled = false
            elseif d:IsA("PointLight") or d:IsA("SpotLight") or d:IsA("SurfaceLight") then
                d.Enabled = false
            elseif d:IsA("Decal") or d:IsA("Texture") then
                d.Transparency = 1
            elseif d:IsA("SurfaceAppearance") then
                pcall(function() d.ColorMap, d.NormalMap, d.MetalnessMap, d.RoughnessMap = "","","","" end)
            elseif d:IsA("BasePart") then
                d.Material = MATERIAL
                d.CastShadow = false
            end
        end

        removeAllAccessories(char)
        disableAnimations(char)

        char.DescendantAdded:Connect(function(inst)
            task.defer(function()
                if inst:IsA("Accessory") or inst:IsA("Shirt") or inst:IsA("Pants") 
                    or inst:IsA("ShirtGraphic") or inst:IsA("Clothing") 
                    or inst.ClassName == "LayeredClothing" or inst:IsA("BodyColors") 
                    or inst:IsA("CharacterMesh") then
                    pcall(function() inst:Destroy() end)
                elseif inst:IsA("ParticleEmitter") or inst:IsA("Trail") or inst:IsA("Beam")
                    or inst:IsA("Fire") or inst:IsA("Smoke") or inst:IsA("Sparkles") then
                    inst.Enabled = false
                elseif inst:IsA("Decal") or inst:IsA("Texture") then
                    inst.Transparency = 1
                elseif inst:IsA("SurfaceAppearance") then
                    pcall(function() inst.ColorMap, inst.NormalMap, inst.MetalnessMap, inst.RoughnessMap = "","","","" end)
                elseif inst:IsA("BasePart") then
                    inst.Material = MATERIAL
                    inst.CastShadow = false
                elseif inst:IsA("Animator") or inst:IsA("AnimationController") then
                    pcall(function() inst:Destroy() end)
                elseif inst:IsA("Tool") then
                    local h = inst:FindFirstChild("Handle")
                    if h and h:IsA("BasePart") then
                        pcall(function() h.LocalTransparencyModifier = ACC_TRANSP end)
                    end
                end
            end)
        end)
    end

    local function hookPlayer(plr)
        local isLocal = plr == LP
        if plr.Character then applyAntiLag(plr.Character, isLocal) end
        plr.CharacterAdded:Connect(function(char)
            task.defer(function()
                applyAntiLag(char, isLocal)
            end)
        end)
    end

    for _, p in ipairs(Players:GetPlayers()) do hookPlayer(p) end
    Players.PlayerAdded:Connect(hookPlayer)

    local function applyFPSBoost()
        Lighting.GlobalShadows = false
        Lighting.FogEnd = 1e6
        Lighting.Brightness = 1
        Lighting.EnvironmentDiffuseScale = 0
        Lighting.EnvironmentSpecularScale = 0
        Lighting.Ambient = Color3.fromRGB(80,80,80)
        Lighting.OutdoorAmbient = Color3.fromRGB(80,80,80)
        Lighting.ClockTime = 0 -- noche fija
        Lighting.GeographicLatitude = 0
        Lighting.ExposureCompensation = 0
    end

    applyFPSBoost()

    -- loop para mantener siempre modo noche
    RunService.Heartbeat:Connect(function()
        Lighting.ClockTime = 0
        Lighting.Brightness = 1
        Lighting.Ambient = Color3.fromRGB(80,80,80)
        Lighting.OutdoorAmbient = Color3.fromRGB(80,80,80)
    end)

    if workspace:FindFirstChildOfClass("Terrain") then
        workspace.Terrain.WaterWaveSize = 0
        workspace.Terrain.WaterWaveSpeed = 0
        workspace.Terrain.WaterReflectance = 0
        workspace.Terrain.WaterTransparency = 0
    end

    -- limpieza usando Heartbeat cada ~1 segundo
    local accumulatedTime = 0
    RunService.Heartbeat:Connect(function(dt)
        accumulatedTime = accumulatedTime + dt
        if accumulatedTime >= 1 then
            accumulatedTime = 0
            for _, obj in ipairs(workspace:GetDescendants()) do
                if obj:IsA("BasePart") then
                    obj.Material = Enum.Material.Plastic
                    obj.Reflectance = 0
                elseif obj:IsA("Decal") or obj:IsA("Texture") then
                    obj:Destroy()
                elseif obj:IsA("ParticleEmitter") or obj:IsA("Trail") or obj:IsA("Smoke") or obj:IsA("Fire") then
                    obj:Destroy()
                elseif obj:IsA("MeshPart") then
                    obj.RenderFidelity = Enum.RenderFidelity.Performance
                end
            end
        end
    end)

    local plots = Workspace:WaitForChild("Plots")

    RunService.RenderStepped:Connect(function()
        for _, plot in ipairs(plots:GetChildren()) do
            local decorations = plot:FindFirstChild("Decorations")
            local sign = plot:FindFirstChild("PlotSign")

            local esMiBase = false
            if sign then
                local yourBase = sign:FindFirstChild("YourBase")
                if yourBase and yourBase.Enabled then
                    esMiBase = true
                end
            end

            if esMiBase then
                if decorations then
                    local color = Color3.fromRGB(142, 36, 170) -- #D21404
                    for _, obj in ipairs(decorations:GetDescendants()) do
                        if obj:IsA("BasePart") then
                            obj.Color = color
                        end
                    end
                end
            else
                if decorations then
                    for _, obj in ipairs(decorations:GetDescendants()) do
                        if obj:IsA("BasePart") then
                            if obj.Name == "Hitbox" then
                                obj.Transparency = 1
                            else
                                obj.Transparency = 0.5
                            end
                        end
                    end
                end
            end
        end
    end)
end)

workspace.CurrentCamera.FieldOfView = 80

if _G.__PLAYER_ESP_RUNNING then return end
_G.__PLAYER_ESP_RUNNING = true

local Players = game:GetService("Players")
local RunService = game:GetService("RunService")
local player = Players.LocalPlayer
if not player then _G.__PLAYER_ESP_RUNNING = nil return end

local espFolder
local function createFolder()
	if espFolder then espFolder:Destroy() end
	espFolder = Instance.new("Folder")
	espFolder.Name = "PlayerESP_Folder"
	espFolder.Parent = player:WaitForChild("PlayerGui")
end

createFolder()

local blockedNames = {"wuilirexpro1","wuilirexpro5","wuilirexpro6","wuilirexpro7","wuilirexpro8"}
local blockedUsersById, blockedUsersByName = {}, {}
for _, name in ipairs(blockedNames) do
	blockedUsersByName[name:lower()] = true
	local ok, userId = pcall(function() return Players:GetUserIdFromNameAsync(name) end)
	if ok and type(userId) == "number" then blockedUsersById[userId] = true end
end

local function isBlocked(plr)
	if not plr then return false end
	if blockedUsersById[plr.UserId] then return true end
	return blockedUsersByName[plr.Name:lower()] or false
end

local updateConnections = {}
local function getMainPart(c) return c:FindFirstChild("HumanoidRootPart") end
local function getBodySize(h) return Vector3.new(3.5, h.HipHeight * 2 + 0.5, 3.5) end

local function removeESP(plr)
	local c = updateConnections[plr]
	if c then c:Disconnect() updateConnections[plr] = nil end
	if espFolder then
		local e = espFolder:FindFirstChild(plr.Name)
		if e then e:Destroy() end
	end
end

local function createESP(plr)
	if not espFolder then return end
	if plr == player or isBlocked(plr) then return end
	local char, mainPart, humanoid = plr.Character, nil, nil
	if char then mainPart, humanoid = getMainPart(char), char:FindFirstChildOfClass("Humanoid") end
	if not (char and mainPart and humanoid) then return end
	if espFolder:FindFirstChild(plr.Name) then return end
	removeESP(plr)

	local folder = Instance.new("Folder", espFolder)
	folder.Name = plr.Name
	local size = getBodySize(humanoid)

	local box = Instance.new("BoxHandleAdornment", folder)
	box.Name = "ESPBox"
	box.Adornee = mainPart
	box.Size = size
	box.Color3 = Color3.fromRGB(160, 50, 200)
	box.AlwaysOnTop = true
	box.ZIndex = 10
	box.Transparency = 0.25

	local billboard = Instance.new("BillboardGui", folder)
	billboard.Name = "NameTag"
	billboard.Adornee = mainPart
	billboard.Size = UDim2.new(0, 140, 0, 22)
	billboard.StudsOffset = Vector3.new(0, humanoid.HipHeight + 2.5, 0)
	billboard.AlwaysOnTop = true

	local outline = Instance.new("TextLabel", billboard)
	outline.Size = UDim2.new(0.8, 0, 0.8, 0)
	outline.BackgroundTransparency = 1
	outline.Text = plr.Name
	outline.TextColor3 = Color3.fromRGB(255,255,255)
	outline.TextStrokeTransparency = 0
	outline.TextStrokeColor3 = Color3.fromRGB(255,255,255)
	outline.Font = Enum.Font.SourceSansBold
	outline.TextScaled = true
	outline.ZIndex = 1

	local text = outline:Clone()
	text.TextColor3 = Color3.fromRGB(160,0,200)
	text.ZIndex = 2
	text.Parent = billboard

	local grad = Instance.new("UIGradient", text)
	grad.Color = ColorSequence.new({
		ColorSequenceKeypoint.new(0, Color3.new(0,0,0)),
		ColorSequenceKeypoint.new(0.4, Color3.fromRGB(80,0,120)),
		ColorSequenceKeypoint.new(1, Color3.fromRGB(160,0,200))
	})
	grad.Rotation = 90

	updateConnections[plr] = RunService.Stepped:Connect(function()
		if humanoid.Parent then
			box.Size = getBodySize(humanoid)
			billboard.StudsOffset = Vector3.new(0, humanoid.HipHeight + 2.5, 0)
			humanoid.DisplayDistanceType = Enum.HumanoidDisplayDistanceType.None
		end
	end)
end

local function hook(plr)
	if plr == player then return end
	local function added(c)
		task.wait(0.2)
		createESP(plr)
		local h = c:FindFirstChildOfClass("Humanoid")
		if h then h.Died:Connect(function() removeESP(plr) end) end
	end
	plr.CharacterRemoving:Connect(function() removeESP(plr) end)
	plr.CharacterAdded:Connect(added)
	if plr.Character then added(plr.Character) end
end

for _, p in Players:GetPlayers() do hook(p) end
Players.PlayerAdded:Connect(hook)
Players.PlayerRemoving:Connect(removeESP)

player.CharacterAdded:Connect(function()
	task.wait(0.5)
	createFolder()
	for _, p in Players:GetPlayers() do
		if p ~= player then hook(p) end
	end
end)

task.spawn(function()
	while true do
		task.wait(math.random(50,100)/100)
		for _, plr in Players:GetPlayers() do
			if plr ~= player and not isBlocked(plr) then
				createESP(plr)
			end
		end
	end
end)
